import Container from "@mui/material/Container";
import Grid from "@mui/material/Grid";

export const Login = () => {
  return (
    <Container maxWidth="lg" id="login">
      <Grid container spacing={12}>
        <Grid item xs={4} md={4}>
          <h1>Multioptica</h1>
        </Grid>
        <Grid item xs={6}>
          <Grid container spacing={2}>
            <Grid item md={16} xs={4}>
              <div id="loginContent">
                <h2>Iniciar Sesion</h2>
              </div>
            </Grid>
          </Grid>
        </Grid>
      </Grid>
    </Container>
  );
};
